  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID（自增，对应实体Long类型）',
  `dataset_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '姿态数据集名称（关联训练所用的标准姿态数据集）',
  `score` decimal(5, 2) NULL DEFAULT NULL COMMENT '姿态评分（0.00-100.00，综合评估训练姿态达标程度）',
  `risk_level` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '风险等级（低/中/高，根据姿态评分或关键指标判定）',
  `progress` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '训练进度（0.00-100.00，单位%）',
  `device_status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '设备状态（已连接/断开连接，训练设备的通信状态）',
  `arm_angle` decimal(6, 2) NULL DEFAULT NULL COMMENT '手臂角度（单位°，0.00-180.00，训练时手臂弯曲/伸展角度）',
  `wrist_position` decimal(6, 2) NULL DEFAULT NULL COMMENT '腕部位置（单位cm，训练时腕部相对于基准点的距离）',
  `body_posture` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '身体姿态（正常/偏移/异常，整体身体姿态评估结果）',
  `spray_distance` decimal(6, 2) NULL DEFAULT NULL COMMENT '喷涂距离（单位cm，喷头与喷涂面的垂直距离）',
  `spray_angle` decimal(6, 2) NULL DEFAULT NULL COMMENT '喷涂角度（单位°，0.00-90.00，喷头与喷涂面的夹角）',
  `pressure` decimal(8, 2) NULL DEFAULT NULL COMMENT '压力值（喷涂设备的工作压力，单位根据实际业务定义，如MPa）',
  `create_time` datetime NOT NULL COMMENT '创建时间（训练记录生成时间）',
  `update_time` datetime NOT NULL COMMENT '更新时间（训练数据最后更新时间）',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_dataset_name`(`dataset_name`) USING BTREE,
  INDEX `idx_risk_level`(`risk_level`) USING BTREE,
  INDEX `idx_device_status`(`device_status`) USING BTREE,
  INDEX `idx_create_time`(`create_time`) USING BTREE,
  INDEX `idx_update_time`(`update_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1001 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '姿态训练表（喷涂场景）' ROW_FORMAT = Dynamic;

